import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import ResultPanel from "../components/ResultPanel";
import Analytics from "../components/Analytics";
import ReviewPanel from "../components/ReviewPanel";

// inside your ResultPage or wherever you want to review answers

<ReviewPanel
  questions={resultData.questions}
  answers={resultData.answers}
  config={resultData.config}
/>

export default function ResultPage() {
  const navigate = useNavigate();

  const [resultData, setResultData] = useState(null);
  const [score, setScore] = useState(0);
  const [maxScore, setMaxScore] = useState(0);
  const [topicAccuracy, setTopicAccuracy] = useState({});

  // Added states for counts
  const [correctCount, setCorrectCount] = useState(0);
  const [incorrectCount, setIncorrectCount] = useState(0);
  const [unattemptedCount, setUnattemptedCount] = useState(0);

  // Load resultData from localStorage on mount
  useEffect(() => {
    const savedResult = localStorage.getItem("mockResult");
    if (savedResult) {
      try {
        setResultData(JSON.parse(savedResult));
      } catch (e) {
        console.error("Failed to parse saved result:", e);
        alert("Error loading results. Redirecting to home.");
        navigate("/");
      }
    } else {
      alert("No results found. Redirecting to home.");
      navigate("/");
    }
  }, [navigate]);

  // Utility to check array equality ignoring order
  function arraysEqualIgnoringOrder(a, b) {
    if (a.length !== b.length) return false;
    const sortedA = [...a].sort();
    const sortedB = [...b].sort();
    return sortedA.every((val, idx) => val === sortedB[idx]);
  }

  // Calculate scores and topic accuracy when resultData is loaded
  useEffect(() => {
    if (!resultData) return;

    let totalScore = 0;
    let maxPossibleScore = 0;
    let correct = 0,
      incorrect = 0,
      unattempted = 0;

    const marking = resultData.config.marking;
    // Fix here: config.type is 'single' or 'multi'
    const isMulti = resultData.config.type === "multi";

    const topicWise = {};
    const topics = resultData.config.topics
      .split(",")
      .map((t) => t.trim().toLowerCase());

    for (let i = 0; i < resultData.questions.length; i++) {
      const q = resultData.questions[i];
      const userAns = resultData.answers[i] || [];
      const correctAns = q.correctAnswers || [];

      let qScore = 0;
      maxPossibleScore += isMulti
        ? marking.correctMultiFull
        : marking.correctSingle;

      if (userAns.length === 0) {
        qScore = marking.unattempted;
        unattempted++;
      } else if (isMulti) {
        const isFullyCorrect = arraysEqualIgnoringOrder(userAns, correctAns);
        const isPartiallyCorrect = userAns.every((ans) =>
          correctAns.includes(ans)
        );
        const hasWrong = userAns.some((ans) => !correctAns.includes(ans));

        if (isFullyCorrect) {
          qScore = marking.correctMultiFull;
          correct++;
        } else if (!hasWrong && isPartiallyCorrect) {
          qScore = marking.correctMultiPartial;
          correct++;
        } else {
          qScore = marking.incorrectMulti;
          incorrect++;
        }
      } else {
        if (userAns[0] === correctAns[0]) {
          qScore = marking.correctSingle;
          correct++;
        } else {
          qScore = marking.incorrectSingle;
          incorrect++;
        }
      }

      totalScore += qScore;

      topics.forEach((topic) => {
        if (!topicWise[topic]) topicWise[topic] = { correct: 0, total: 0 };
        topicWise[topic].total++;
        if (qScore > 0) topicWise[topic].correct++;
      });
    }

    setScore(totalScore);
    setMaxScore(maxPossibleScore);
    setCorrectCount(correct);
    setIncorrectCount(incorrect);
    setUnattemptedCount(unattempted);

    const topicAcc = {};
    for (const t in topicWise) {
      topicAcc[t] = ((topicWise[t].correct / topicWise[t].total) * 100).toFixed(
        1
      );
    }
    setTopicAccuracy(topicAcc);
  }, [resultData]);

  if (!resultData) {
    return <div className="container py-5">Loading results...</div>;
  }

  return (
    <div className="container py-5">
      <h2 className="mb-4">ðŸ“Š Test Results</h2>

      <ResultPanel score={score} maxScore={maxScore} />

      <Analytics
        topicAccuracy={topicAccuracy}
        correct={correctCount}
        incorrect={incorrectCount}
        unattempted={unattemptedCount}
      />

      <button className="btn btn-primary" onClick={() => navigate("/")}>
        ðŸ”„ Retake Test
      </button>
    </div>
  );
}
